import React, { useEffect } from 'react';
import p5 from 'p5';
import { parallaxSketch } from './parallaxSketch';
import styles from './mainMenu.module.css';

function MainMenu() {
    useEffect(() => {
        const sketch = new p5(parallaxSketch);
        return () => sketch.remove();
    }, []);

    return (
        <div className={styles.mainMenuContainer}>
            <div className={styles.parallaxCanvas}></div> {/* Parallax Canvas */}
            <header className={styles.header}>
                <h1 className={styles.logo}>Senp<span id="highlight">ai</span> Suggests</h1>
            </header>
            <div className={styles.welcomeOverlay}>
                <h1 className={styles.welcomeText}>Welcome to Senp<span id="highlight">ai</span> Suggests!</h1>
            </div>
            <div className={styles.menu}>
                <a href="#myWatchlist" className={styles.menuItem}>My Watchlist</a>
                <a href="#myWishlist" className={styles.menuItem}>My Wishlist</a>
                <a href="#lucky" className={styles.menuItem}>I'm Feeling Lucky</a>
            </div>
        </div>
    );
}

export default MainMenu;
